  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA CoastWatch distributes near real time
  Ekman current (in zonal, meridional, and modulus sets) and Ekman upwelling data.
  \ This data begins with wind velocity measurements from the SeaWinds instrument
  onboard NASA's QuikSCAT satellite.  SeaWinds is a microwave scatterometer designed
  to measure surface winds over the global ocean.  NOAA CoastWatch processes wind
  velocity to wind stress and wind stress curl, and finally to Ekman current and Ekman
  upwelling.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
